import { useEffect, useState } from 'react';
import './App.css';
import axios from "axios";

function App() {
  const [data, setData] = useState(null);

function getAPI() {
  axios.get('/api').then((response) => {
    setData((response.message));
    console.log((response.message));
  })
}

  useEffect(() => {

  });


  return (
    <div className="App">
      <header className="App-header">
      <p>{data.message}</p> 
      </header>
    </div>
  );

}

export default App;
